     &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport dask\nfrom dask.distributed import performance_report, Client\nimport json \nfrom dask_ml.decomposition import InSituIncrementalPCA\nimport time \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr) #, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr) #, timeout=60, heartbeat_interval=10)\n    return client\n\n\n# Get client\nclient = connect(scheduler_info)\ndask.config.set({\"distributed.deploy.lost-worker-timeout\": 60, \"distributed.workers.memory.spill\":0.97, \"distributed.workers.memory.target\":0.95, \"distributed.workers.memory.terminate\":0.99 })\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    \n    pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n    print(\"pca, \", pca, flush=True)\n\n    l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1430","type":"AllLabels"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1468","type":"MonthsTicker"},{"attributes":{},"id":"1267","type":"ResetTool"},{"attributes":{"axis":{"id":"1012"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1015","type":"Grid"},{"attributes":{"callback":null},"id":"1020","type":"TapTool"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"data":{"bandwidth":{"__ndarray__":"g6Qn3Jav00G3X4GdqYG9Qcj9m+ihsc5BH4ZpFK2eskGo6JER/HHJQYgMOOLxvcpByEXXLJ8lvEGNuRx99BS9Qe2hX2xwJb9BXKzwhBq9yUFLoxRK41+9QbgKo7l+P8BB4mkngofwt0FNFWmMoMq7QY1O5g3dE8BBvDUwQlKSuEECZXSNkR3AQSDWvYSsg8RBFmXAVrAFwUFmfqfRQT+sQas2ofYW7rJB/JFm61T+sEHmhALHtqGzQXgM31f2C71BjGue0S1fqEFPk9+/1Pm+Qd5SDuRWN7RBiBqWLyjPukGJenFA+8exQeGoezIbLa5BubBXgtE9rkHhNypkrEO5QWjF/LMCVpdBK9oZ7IKxaUH3MP7SWKG2QfNhytXNWrZB5hwmVDyHr0E=","dtype":"float64","order":"little","shape":[37]},"bandwidth_text":["1.23 GiB","472.10 MiB","0.96 GiB","297.92 MiB","814.25 MiB","855.74 MiB","450.35 MiB","465.31 MiB","498.34 MiB","823.64 MiB","469.99 MiB","519.94 MiB","383.03 MiB","444.66 MiB","514.48 MiB","393.15 MiB","515.70 MiB","656.46 MiB","544.71 MiB","225.98 MiB","302.88 MiB","271.90 MiB","314.11 MiB","464.75 MiB","194.97 MiB","495.61 MiB","323.46 MiB","428.95 MiB","284.50 MiB","241.41 MiB","241.93 MiB","404.23 MiB","93.34 MiB","12.85 MiB","362.08 MiB","357.68 MiB","252.23 MiB"],"destination":["tcp://172.21.6.227:44569","tcp://172.21.6.230:40747","tcp://172.21.6.231:44198","tcp://172.21.6.227:37855","tcp://172.2
